body.script:
const themeColors = { // Temp solution while we can't inject it to body directly until react load
      default: '#EFF4FA',
      classic_dark: '#151F28',
      dark_green: '#07041C',
      dark_orange: '#122146',
      dark_violet: '#190829',
      pink: '#FAF0F3',
      mint: '#05191A',
      gray_red: '#F3F7FA',
      black: '#000000',
    }

    const loadingStyle = document.createElement('style');
    loadingStyle.innerHTML = `
      .custom-loading::after {
        background: url('${window.__PRELOADED_STATE__?.panel.logo}') no-repeat !important;
        background-size: contain !important;
      }

      #app:empty {
        background: ${themeColors[window.__PRELOADED_STATE__?.panel.landing.landing_theme || 'default']}
      }
    `;
    document.getElementsByTagName('head')[0].appendChild(loadingStyle);
